import React from "react";
import { Link } from "react-router-dom";

export default function Navbar() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
      <div className="container">
        <Link className="navbar-brand" to="/">Dashboard Admin</Link>
        <div>
          <Link className="nav-link d-inline text-light" to="/users">Utilisateurs</Link>
          <Link className="nav-link d-inline text-light" to="/passages">Passages</Link>
        </div>
      </div>
    </nav>
  );
}
